import { Container, Row, Col } from 'react-bootstrap';

const Footer = () => {
  return (
    <div>
      <footer>
        <Container>
          <Row>
            <Col></Col>
          </Row>
        </Container>
      </footer>
    </div>
  );
};

export default Footer;
